import React from "react";
import Footer from "./Footer";
import Header from "./Header";
import Note from "./Note";
import noteData from "../noteDeta";

function App() {
  return (
    <div>
      <Header />
      {noteData.map((data) => {
        return (
          <Note key={data.key} title={data.title} content={data.content} />
        );
      })}
      <Footer />
    </div>
  );
}

export default App;
